import React from 'react';
import { useSelector } from 'react-redux';

function Card() {
  const movies = useSelector((state) => state.MovieData.movies);

  return (
    <div>
      <div className='cards'></div>
      {
        movies.map((movie) => (
          <span style={{color:"white"}} key={movie.id}>{movie.title}</span>
        ))
      }
    </div>
  );
}

export default Card;
